import React from "react";

class Contact extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isSubmitted: false
    };
  }

  handleSubmit() {
    this.setState({ isSubmitted: true });
  }
  render() {
    return (
      <div className="contacts">
        <h1>Contact</h1>
      </div>
    );
  }
}

export default Contact;
